  true,\n\t\"url\": null,\n\t\"notes\": \"<div>rn This dataset includes simulation
  results from a national-scale study of the commercial buildings sector.  Electric
  load profiles contain the hour-by-hour demand for electricity for each building.
  Summary tables describe individual buildings and their overall annual energy performance.
  \ The study developed detailed EnergyPlus models for 4,820 different samples in
  2003 CBECS.  Simulation output is available for all and organized by CBECSu2019s
  identification number in public use datasets.  Three modeling scenarios are available:
  existing stock (with 2003 historical weather), stock as if rebuilt new (with typical
  weather), and the stock if rebuilt using maximum efficiency technology (with typical
  weather).rn</div>rnrn<br />rnrn<div>rnThe following reports describe how the dataset
  was developed:rn <ul style=\"margin-left: 30px\">rn  <li><a href=\"http://www.nrel.gov/docs/fy08osti/41956.pdf\">Methodology
  for Modeling Building Energy Performance across the Commercial Sector</li>rn  <li><a
  href=\"http://www.nrel.gov/docs/fy08osti/41957.pdf\">Assessment of the Technical.
  Potential for Achieving Net Zero-Energy Buildings in the Commercial Sector</li>rn
  </ul>rn</div>rnrn<br />rnrn<div>rn The contents of this dataset are available at:rn
